		border: 0;
		outline: 0;
		-ms-filter: "progid:DXImageTransform.Microsoft.Alpha(Opacity=1)";
		filter: alpha(opacity=1);
		opacity: 0.01;
	}

	.month-wrapper {

		border-radius: 3px;
		background-color: #fff;

		cursor: default;
		position: relative;
		_overflow: hidden;

		table {
			width: 280px;
			float: left;
			font-size: 12px;

			&.month2 {
				width: 190px;
				float: left;
			}

			th,
			td {
				height: 40px;
				width: 40px;
				vertical-align: middle;
				text-align: center;
				line-height: 40px;
				margin: 0px;
				padding: 0px;
			}

			div.day,
			.real-today {
				// padding: 5px 0;
				line-height: 40px;
				font-size: 12px;
				margin-bottom: 1px;
				// color: #ffffff;
				cursor: default;
			}

			div.day {

				&.lastMonth,
				&.nextMonth {
					color: $color-ds25;
					cursor: default;
				}
			}

			.day.checked {
				background: $color-purple-gradient25;

			}

			.week-name {
				height: 40px;
				font-size: 12px;
				line-height: 20px;
				font-weight: 100;
				text-transform: capitalize;
			}

			.day.has-tooltip {
				cursor: help !important;

				.tooltip {
					white-space: nowrap;
				}
			}
		}
	}

	.time label {
		white-space: nowrap;
	}

