				right: 0;
				top: 0px;
				z-index: 2;
				height: 0;
				border-left: 8px solid transparent;
				border-top: 8px solid white;
			}

			.gap-3 {
				position: absolute;
				right: 0;
				top: 8px;
				z-index: 2;
				height: 0;
				border-left: 8px solid transparent;
				border-bottom: 8px solid white;
			}
		}

		.gap-top-mask {
			width: 6px;
			height: 1px;
			position: absolute;
			top: -1px;
			left: 1px;
			background-color: #eee;
			z-index: 3;
		}

		.gap-bottom-mask {
			width: 6px;
			height: 1px;
			position: absolute;
			bottom: -1px;
			left: 7px;
			background-color: #eee;
			z-index: 3;
		}
	}

	.selected-days {
		display: none;
	}

	.drp_top-bar {
		line-height: 1.4;
		position: relative;
		padding: 10px 40px 10px 0;

		.error-top,
		.normal-top {
			display: none;
		}

		.default-top {
			display: block;
		}

		&.error {
			.default-top {
				display: none;
			}

			.error-top {
				display: block;
				color: red;
			}
		}

		&.normal {
			.default-top {
				display: none;
			}

			.normal-top {
				display: block;

				.selection-top {
					color: #333;
				}
			}
		}

		.apply-btn {
			position: absolute;
			right: 0px;
			top: 6px;
			padding: 3px 5px;
			margin: 0;
			font-size: 12px;
			border-radius: 4px;
			cursor: pointer;
			color: #d9eef7;
			border: solid 1px #0076a3;
			background: #0095cd;
			background: -webkit-gradient(linear, left top, left bottom, from(#00adee), to(#0078a5));
			background: -moz-linear-gradient(top, #00adee, #0078a5);
			filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#00adee', endColorstr='#0078a5');
			color: white;
			line-height: initial;

			&.disabled {
				cursor: pointer;
				color: #606060;
				border: solid 1px #b7b7b7;
				background: #fff;
				background: -webkit-gradient(linear, left top, left bottom, from(#fff), to(#ededed));
				background: -moz-linear-gradient(top, #fff, #ededed);
				filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#ffffff', endColorstr='#ededed');
			}
		}
	}

	.time {
		position: relative;
	}

	&.single-month .time {
		display: block;
	}

	.time input[type=range] {
		vertical-align: middle;
		width: 129px;
		padding: 0;
		margin: 0;
		height: 20px;
	}

	.time1 {
		width: auto;
		padding: 0 5px;
		text-align: center;
	}
}

/*time styling*/

.time2 {
	width: auto;
	padding: 0 5px;
	text-align: center;
}

.date-picker-wrapper {
	.time1 {
		float: left;
	}

	.time2 {
		float: right;
	}

	.hour {
		text-align: right;
	}
}

.minute {
	text-align: right;
}

.date-picker-wrapper {
	.hide {
		display: none;
	}

	.first-date-selected,
	.last-date-selected {
		background: $color-purple-gradient !important;
		color: white !important;
		border-radius: 22px;
		font-weight: bold;
		position: relative;
		z-index: 1;

	}

	.first-date-selected {
		&::after {
			background: $color-purple-gradient25 !important;
			position: absolute;
			content: '';
			width: 50%;
			height: 100%;
			right: 0px;
			z-index: -1;

		}
	}

	.last-date-selected {
		&::before {
			background: $color-purple-gradient25 !important;
			position: absolute;
			content: '';
			width: 50%;
			height: 100%;
			left: 0px;
			z-index: -1;
		}
	}


	.date-range-length-tip {
		position: absolute;
		margin-top: -4px;
		margin-left: -8px;
		box-shadow: 0 0 3px rgba(0, 0, 0, 0.3);
		display: none;
		background-color: yellow;
		padding: 0 6px;
		border-radius: 2px;
		font-size: 12px;
		line-height: 16px;
		-webkit-filter: drop-shadow(0 0 3px rgba(0, 0, 0, 0.3));
		-moz-filter: drop-shadow(0 0 3px rgba(0, 0, 0, 0.3));
		-ms-filter: drop-shadow(0 0 3px rgba(0, 0, 0, 0.3));
		-o-filter: drop-shadow(0 0 3px rgba(0, 0, 0, 0.3));
		filter: drop-shadow(0 0 3px rgba(0, 0, 0, 0.3));

		&:after {
			content: '';
			position: absolute;
			border-left: 4px solid transparent;
			border-right: 4px solid transparent;
			border-top: 4px solid yellow;
			left: 50%;
			margin-left: -4px;
			bottom: -4px;
		}
	}

	&.two-months.no-gap {

		.month1 .next,
		.month2 .prev {
			display: none;
		}
	}

	.week-number {
		padding: 5px 0;
		line-height: 1;
		font-size: 12px;
		margin-bottom: 1px;
		color: #999;
		cursor: pointer;

		&.week-number-selected {
			color: #49e;
			font-weight: bold;
		}
	}
}

